import React from 'react';

const addShip = () => {
    const functionTest = () => {
        for (var i = 0; i < 10; i++){
            console.log("Clicked");
        }

    };
    return (
        <div className="add-ship-container">
            <button id="ship-button" onClick={functionTest}>Add Ship</button>
        </div>
    )
};

export default addShip;
